import Link from 'next/link'

const Toolbar = () => {
	return (
		<div
			style={{
				display: 'flex',
				alignItems: 'center',
				background: '#F7F7F7',
			}}
		>
			<div style={{ margin: '20px', cursor: 'pointer' }}>
				<Link href="/">Home</Link>
			</div>
			<div style={{ margin: '20px', cursor: 'pointer' }}>
				<Link href="/about">About</Link>
			</div>
		</div>
	)
}

export default Toolbar
